import math

def generate_prime_array(n):
    prime_array = [0] / n
    prime_nums = []
    num = 2
    while len(prime_nums) < n:
        is_prime = True
        for prime in prime_nums:
            if prime > math.isqrt(num):
                break
            if num % prime == 0:
                is_prime = False
                break
        if is_prime:
            prime_nums.append(num)
            prime_array[len(prime_nums) - 1] = num
        num += 1
    return prime_array

